informacaoComplementar:
A realização dos Exames Médicos Periódicos para os servidores públicos federais encontra respaldo no Decreto n° 6.856, de 25 de maio de 2009, regulamentado pela Portaria Normativa n.º 04, de 15 de setembro de 2009, da Secretaria de Recursos Humanos/MF, com as alterações introduzidas pela Portaria Normativa n.º 06, de 21 de dezembro de 2010.
1.4.2. Igualmente a realização de exames médicos ocupacionais encontra-se respaldada na Norma Regulamentadora n.º 07 (NR 07), que trata da obrigação dos empregadores elaborarem e implementarem o Programa de Controle Médico de Saúde Ocupacional (PCMSO), aprovado pelo Ministério do Trabalho e Emprego (MTE), com a redação proposta pela Portaria SEPRT n.º 6.734/2020, tendo como última alteração implementada a Portaria MTP n.º 1.854/2022.
Conforme previsto no PCMSO, nos termos do subitem 7.5.6 da NR-7, é obrigatória a realização dos seguintes exames médicos ocupacionais:
1.4.2.1. Admissionais;
1.4.2.2. Periódicos;
1.4.2.3. De retorno ao trabalho;
1.4.2.4. De mudança de função ocupacional;
1.4.2.5. Demissionais.
1.4.3. A definição dos exames complementares necessários constam do PCMSO da CNEN, atualizado em 2024 pela médica coordenadora, permitindo a realização dos exames clínicos por Médico do Trabalho examinador conveniado.

E notável a necessidade desta contratação, por se tratar de prestação de serviço essencial e imprescindível, uma vez que a energia elétrica é fundamental para o desenvolvimento das atividades laborais e para a prestação de serviço à classe contabilista, Considerando Que no Estado de Roraima há apenas uma prestadora de serviços de fornecimento de energia elétrica;

Que este tipo de serviço, em regra, é prestado em regime de exclusividade, sendo a tarifa cobrada definida pelo Poder Público, inexistindo possibilidade de competição e a contratação desses serviços ocorre sempre com a mesma pessoa jurídica, no caso, a RORAIMA ENERGIA S. A.

Que a RORAIMA ENERGIA S. A. é a única competente no município de Boa Vista apta ao fornecimento de energia elétrica, o que impossibilita a realização do procedimento licitatório;

Que a contratação ocorre basicamente, nos mesmos termos, ademais trata-se de serviço de duração continuada, imprescindível ao funcionamento do Conselho Regional de Contabilidade de Roraima.
